List.prototype.plugins.paging = function(locals, options) {
    var list = this;
    var pagingList;
    var init = function() {
        options = options || {};
        pagingList = new List(list.listContainer.id, {
            listClass: options.pagingClass || 'paging',
            // scroll page to bottom when clicked to force pagination to be static
            item: "<li><a class='page' href='javascript:window.scrollTo(0, document.height)'></a></li>", // Have to contain something, can't set valueName at root element
            valueNames: ['page', 'dotted'],
            searchClass: 'nosearchclass',
            sortClass: 'nosortclass'
        });
        list.on('updated', refresh);
        refresh();
    };

    var refresh = function() {
        var l = list.matchingItems.length,
            index = list.i,
            page = list.page,
            pages = Math.ceil(l / page),
            currentPage = Math.ceil((index / page)),
            innerWindow = options.innerWindow || 2,
            left = options.left || options.outerWindow || 0,
            right = options.right || options.outerWindow || 0,
            right = pages - right;

        pagingList.clear();

        if (currentPage > 1) {
            var leftBtn = pagingList.add({
                page: '',
                dotted: false
            })[0];
            addEvent(leftBtn.elm, currentPage - 1, page);
        }

        for (var i = 1; i <= pages; i++) {
            if (is.number(i, left, right, currentPage, innerWindow)) {
                var item = pagingList.add({
                    page: i,
                    dotted: false
                })[0];

                if (i === currentPage) {
                   $(item.elm).addClass('active');
                }

                addEvent(item.elm, i, page);
            } else if (is.dotted(i, left, right, currentPage, innerWindow, pagingList.size())) {
                var item = pagingList.add({
                    page: "...",
                    dotted: true
                })[0];

                $(item.elm).addClass('disabled');
            }
        }

        if (currentPage < pages) {
            var rightBtn = pagingList.add({
                page: '',
                dotted: false
            })[0];
            addEvent(rightBtn.elm, currentPage + 1, page);
        }
    };

    var is = {
        number: function(i, left, right, currentPage, innerWindow) {
           return this.left(i, left) || this.right(i, right) || this.innerWindow(i, currentPage, innerWindow);
        },
        left: function(i, left) {
            return (i <= left);
        },
        right: function(i, right) {
            return (i > right);
        },
        innerWindow: function(i, currentPage, innerWindow) {
            return ( i >= (currentPage - innerWindow) && i <= (currentPage + innerWindow));
        },
        dotted: function(i, left, right, currentPage, innerWindow, currentPageItem) {
            return this.dottedLeft(i, left, right, currentPage, innerWindow)
            || (this.dottedRight(i, left, right, currentPage, innerWindow, currentPageItem));
        },
        dottedLeft: function(i, left, right, currentPage, innerWindow) {
            return ((i == (left + 1)) && !this.innerWindow(i, currentPage, innerWindow) && !this.right(i, right))
        },
        dottedRight: function(i, left, right, currentPage, innerWindow, currentPageItem) {
            if (pagingList.items[currentPageItem-1].values().dotted) {
                return false
            } else {
                return ((i == (right)) && !this.innerWindow(i, currentPage, innerWindow) && !this.right(i, right))
            }
        }
    };

    var addEvent = function(elm, i, page) {
       ListJsHelpers.addEvent(elm, 'click', function() {
           list.show((i-1)*page + 1, page);
       });
    };

    init();
    return this;
};

/*global jQuery, _, List */
(function ($) {
	'use strict';

	var API_URL = 'http://bower-component-list.herokuapp.com/';

	function render(data) {
		var listInit = true;

		var sortedByCreated = _.sortBy(data, function (el) {
			return -Date.parse(el.created);
		});

		var latestTpl = _.template($('#components-small-template').html(), {
			title: 'Latest components',
			components: sortedByCreated.slice(0, 5)
		});

		var hotTpl = _.template($('#components-small-template').html(), {
			title: 'Hot components',
			components: _.sortBy(sortedByCreated.slice(0, 50), function (el) {
				return -el.stars;
			}).slice(0, 5)
		});

		var componentsTpl = _.template($('#components-template').html(), {
			components: _.sortBy(data, function (el) {
				return -el.stars;
			})
		});

		$('#loading').hide();
		$('#components')
			.append(latestTpl)
			.append(hotTpl)
			.append(componentsTpl)
			.find('.search').show();

		var list = new List('components', {
			valueNames: [
				'name',
				'description',
				'owner',
				'created',
				'updated',
				'forks',
				'stars'
			],
			page: 10,
			indexAsync: true,
			plugins: [[
				'paging', {
					outerWindow: 1
				}
			]]
		});

		list.on('updated', function () {
			$('#components').find('.created time, .updated time').timeago();

			if (listInit) {
				listInit = false;
				var query = decodeURIComponent(window.location.hash.replace('#!/search/', ''));

				if (query) {
					$('.search').val(query);
					list.search(query);
				}

				// back/forward in the list with arrow-keys
				$(document).on('keyup', function (e) {
					var pageBtns = $('#components').find('.paging li');

					if (e.which === 37) {
						pageBtns.filter(':contains()').click();
					}

					if (e.which === 39) {
						pageBtns.filter(':contains()').click();
					}
				});
			}

			$('.table thead').toggle(list.matchingItems.length !== 0);
			$('#search-notfound').toggle(list.matchingItems.length === 0);
		});

		$('.credit img').on('mouseover mouseout', function (e) {
			$(this).toggleClass('animated tada', e.type === 'mouseover');
		});
	}

	$(function() {
		$.getJSON(API_URL).then(render).fail(function () {
			$('#loading p').text('Failed to load component list :(');
		});
	});
})(jQuery);

